window.bookSummaryJSON = "<p>A rookie cop. A team of supernatural detectives. A power hungry witch on a killing spree.</p> <p>My name is Cat McKenzie, and I’m in over my head.</p> <p>I’d finally come to grips with the fact that not all supernaturals are a**holes when the witch downstairs is murdered, and I’m rescued from certain death by the fae assassin responsible for revealing the existence of supernaturals to humans six months ago.</p> <p>That’s not the best bit though.</p> <p>Said fae wants me and my partner to look into the death of his niece, and he made us an offer we can’t refuse, just like in a bad mob movie.</p> <p>Between zombie cyclops, magical artifacts, and a growing headache, all I want to do is get into my fuzzy unicorn pajamas and crawl into bed. Like hell that’s going to happen anytime soon though....</p>"; 
